import React, { Component } from 'react';
import { Button, Typography } from '@material-ui/core';
import Dropdown from 'muicss/lib/react/dropdown';
import DropdownItem from 'muicss/lib/react/dropdown-item';
import './navbar.css';

class Navbar extends Component {
  navigateTo(page) {
    window.location.href = page;
  }

  render() {
    return (
      <div id="navbar-container">
        <Typography id="navbar-title-container" variant="h2">
          NATALIE WAGNER
        </Typography>
        <div id="navbar-buttons-container">
          <Button color="inherit" onClick={() => this.navigateTo('index.html')}>
            Home
          </Button>
          {/* <Button color="inherit" onClick={() => this.navigateTo('quiz.html')}>
            Quiz
          </Button> */}
          <Button color="inherit" onClick={() => this.navigateTo('links.html')}>
            My Links
          </Button>
          <Button color="inherit" onClick={() => this.navigateTo('emailnatalie.html')}>
            Email Me
          </Button>

          {/* <div class="mui-dropdown">
            <Button color="inherit" onClick={() => this.navigateTo('links.html')} className="mui-btn mui-btn--primary" data-mui-toggle="dropdown">
              My Links
            </Button>
            <ul className="mui-dropdown__menu">
              <li><a href="#">Option 1</a></li>
              <li><a href="#">Option 2</a></li>
              <li><a href="#">Option 3</a></li>
              <li><a href="#">Option 4</a></li>
            </ul>
          </div> */}


          <Dropdown color="primary" label="Dropdown">
            <DropdownItem link="#/link1">Option 1</DropdownItem>
            <DropdownItem>Option 2</DropdownItem>
            <DropdownItem>Option 3</DropdownItem>
            <DropdownItem>Option 4</DropdownItem>
          </Dropdown>
        </div>
      </div>
    );
  }
}

export default Navbar;
